import React, { Component } from 'react'
import './card.scss'

export default class Card extends Component {
    constructor(props){
        super(props);
        this.state={
            game:this.props.game
        };
    }

    render() {
        console.log(this.state.game.name);
        return (
            <div className="card">
                <img src="https://live.staticflickr.com/65535/49211596582_ea95c0a954_b.jpg" alt=""></img>
                <div className="card-container">
                    <h4><b></b></h4>
                    <p></p>
                </div>
            </div>
        )
    }
}
